import React, {useState, useEffect} from 'react';
import {Main, Card, Result} from './AppStyled.js';
import TitleComponent from '../components/Title/Title.jsx';
import SliderComponent from '../components/Slider/Slider.jsx';
import ButtonComponent from '../components/Button/Button.jsx';


const App = () => {

  const [click, setClick] = useState(null);
  const [result, setResult] = useState(null);

  useEffect(() => {
    console.log("voce clicou");
    setResult(1);
  }, [click]);

  if (result != null) {
    return (
      <Main>
        <Card>
          <TitleComponent/> 
          <SliderComponent  type = "peso"/>
          <SliderComponent type = "altura"/>
          <ButtonComponent onclick={setClick(1)}/>
        </Card>
      </Main>
    );
  } else {
    return (
      <Main>
        <Card>
          <TitleComponent/> 
          <SliderComponent type = "peso"/>
          <SliderComponent type = "altura"/>
          <ButtonComponent onclick={setResult(1)}/>
          <Result>{result}</Result>
        </Card>
      </Main>

      );
    }


}

export default App;
